## Proposed changes
Support kill query when it is queued.
```
// case 1: use kill stmt;
kill query 0;

// case 2: use ctr + c
mysql [hits]>select count(1) from hits.hits;
^C^C -- query aborted
ERROR 1105 (HY000): errCode = 2, detailMessage = query is cancelled in queue

```

Currently, Variant writes an `fdb kv` for each `rowset`'s `TabletSchema` upon `commit_rowset`. This approach is due to the schema's granularity being at the rowset level, with each rowset potentially having a unique schema. However, when the number of rowsets exceeds 1000, `get_rowset` operations may face FDB transaction timeouts due to large kv sizes (exceeding 100K), leading to read times over 10ms. To address this, there's a need to optimize the kv size to prevent timeouts, targeting a size reduction to <2k.

The compaction process does not update the schema, potentially merging multiple rowset schemas into a new one without accurately reflecting the changes. This results in inconsistencies and incorrect schema representations in the output rowset.

To reduce the space occupied by `TabletSchema`, which is largely consumed by the `column` and `index` fields, a dictionary compression method is proposed. By encoding these fields into dictionary keys, we can significantly decrease the storage space required. This involves modifications to the `RowsetMetaCloudPB` and the introduction of a `SchemaCloudDictionary` to manage the dictionary keys and ensure efficient storage utilization.

```
message RowsetMetaCloudPB {
  ...
  repeated int32 column_dict_key_list = 26;
  ...
}

message SchemaCloudDictionary {
  map<int32, ColumnPB> column_dict = 1;
  optional int64 current_column_index = 2;
  map<int32, TabletIndexPB> index_dict = 3;
  optional int64 current_index_index = 2;
}

```

